import React, { useState, useEffect } from "react";
import ClassPage from "./ClassPage";
import Courses from "./Courses";
import { Route, Link, NavLink, Switch, Redirect } from "react-router-dom";

export default function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col studyBuddy">iSTUDY BUDDY</div>
        <div className="col chats">Chats</div>
      </div>

      <Switch>
        <Route exact path="/" component={Courses}></Route>
        <Route path="/test/:courseName" component={ClassPage} />
        <Redirect to="/" />
      </Switch>

      <div className="row justify-content-center">
        &copy; 2021 iStudy Buddy, YuYu Madigan, Kayla Lee, Saatvik Arya, Louis Ta
      </div>
    </div>
  );
}
